// Cuando carga la pgina...
$(function () {
  var productoresContainer = $("#mapa-de-productores");
  // Si existe el contenedor del mapa de productores...

  if (productoresContainer.length) {
    // Variables genricas para la seleccin y muestra de productores
    var producersFile = themePath + "api/api.php?get=producers";
    var placesFile = themePath + "api/api.php?get=places&producers=1";

    // Iniciar mapa
    var map = L.map("mapa").setView([-33.7497, -61.9669], 13);

    // Agregar layer de openstreetmap
    L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png?{foo}", {
      foo: "bar",
      attribution:
        'Map data &copy; <a href="https://www.openstreetmap.org/">OpenStreetMap</a> contributors, <a href="https://creativecommons.org/licenses/by-sa/2.0/">CC-BY-SA</a>',
    }).addTo(map);

    // Agregar layer para los markers
    var markerGroup = L.featureGroup().addTo(map);

    // Cambiar el marker por defecto por algo propio
    var customMarker = L.divIcon({ className: "map-marker", iconSize: "30" });

    // Mostramos el layer de la ubicacin
    $(productoresContainer).find(".location").show();

    // Sumamos el select2
    $("#userZip")
      .select2({
        language: "es",
        placeholder: "Seleccion tu ubicacin",
        allowClear: true,
        ajax: {
          url: placesFile,
          processResults: function (data) {
            var results = [];
            $.each(data, function (k, v) {
              results.push({
                id: v.idcity,
                text: v.altName + ", " + v.state + " (" + v.zipcode + ")",
              });
            });

            return {
              results: results,
            };
          },
          data: function (params) {
            var query = {
              q: params.term,
              limit: "20",
            };
            return query;
          },
          cache: true,
        },
      })
      .prop("disabled", false);

    // Si se selecciona una opcin...
    $("#userZip").on("select2:select", function (e) {
      // El Select se mueve arriba
      $(productoresContainer).addClass("selected");

      // Mostramos productores de la ciudad elegida
      var city = $(this).val();
      showProducers(city);
    });

    // Si ya tenemos una ubicacin seleccionada...
    function showProducers(city) {
      // Log
      // console.log(city);

      // Buscamos productores de la ciudad
      $.getJSON(producersFile, { idcity: city }, function (data) {
        // Si hay resultados
        if (data.error !== undefined) {
          productoresContainer.append(
            "<div class='alert'>Tu lmite de consultas diarias ha sido superado.</div>"
          );
        } else {
          if (data.length) {
            // Si se super el lmite de consultas...
            // Vaciamos todos los markers
            markerGroup.clearLayers();

            // Sumamos markers de productores
            $.each(data, function (k, v) {
              var parsedEmail = v.email.replace(";", "<br />");
              L.marker([v.latitud, v.longitud], { icon: customMarker })
                .addTo(markerGroup)
                .bindPopup(
                  "<h1>" +
                    v.productor +
                    "</h1><p><strong>Direccin:</strong> " +
                    v.direccion +
                    ", " +
                    v.localidad +
                    "</p><p><strong>Telfonos:</strong> " +
                    v.telefonos +
                    "</p><p><strong>E-mail:</strong> " +
                    parsedEmail +
                    "</p>"
                );
            });

            // Centrar el mapa en los markers encontrados
            map.fitBounds(markerGroup.getBounds());

            // Si no hay resultados
          } else {
            // ?
            // console.log("No hay resultados");
          }
        }
      });
    }
  }
});

// Cuando carga la pgina...
$(function () {
  var oficinasContainer = $("#mapa-de-oficinas");
  var cachedOffices;

  // Si existe el contenedor del mapa de productores...

  if (oficinasContainer.length) {
    // Obtener oficinas
    $.getJSON(themePath + "data/offices.json", function (data) {
      // Asignamos el resultado a la variable de oficinas
      cachedOffices = data;
    });

    // Iniciar mapa
    var map = L.map("mapa").setView(["-33.7443351", "-61.96413"], 15);

    // Deshabilitamos la rueda para no complicar el scroll?

    // disable scroll-zooming initially
    map.scrollWheelZoom.disable();

    var zoomTimer;

    // on entering the map we're starting a timer to
    // 3 seconds after which we'll enable scroll-zooming
    map.on("mouseover", function () {
      zoomTimer = setTimeout(function () {
        map.scrollWheelZoom.enable();
      }, 3000);
    });

    // on leaving the map we're disarming not yet triggered timers
    // and disabling scrolling
    map.on("mouseout", function () {
      clearTimeout(zoomTimer);
      map.scrollWheelZoom.disable();
    });

    // Agregar layer de openstreetmap
    L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png?{foo}", {
      foo: "bar",
      attribution:
        'Map data &copy; <a href="https://www.openstreetmap.org/">OpenStreetMap</a> contributors, <a href="https://creativecommons.org/licenses/by-sa/2.0/">CC-BY-SA</a>',
    }).addTo(map);

    // Agregar layer para los markers
    var markerGroup = L.featureGroup().addTo(map);

    // Cambiar el marker por defecto por algo propio
    var customMarker = L.divIcon({ className: "map-marker", iconSize: "30" });

    L.marker(["-33.7443351", "-61.96413"], { icon: customMarker })
      .addTo(markerGroup)
      .bindPopup(
        "<img src='" +
          themePath +
          "assets/img/oficinas/casacentral.jpg' alt='' width='300' height='220' /><h1>Oficina Central</h1><p>25 de Mayo 530, Venado Tuerto (Santa F)</p><p>03462-435100 / 435200 y lneas rotativas</p><p><a href='mailto:info@cooperacionseguros.com.ar'>info@cooperacionseguros.com.ar</a>"
      )
      .openPopup();

    // Actualizar provincia
    $(".provincias li").on("click", function (event) {
      // Marcar elemento activo
      $(this).siblings().removeClass("active");
      $(this).addClass("active");

      // Definir qu lista usamos
      var provincia = $(this).data("provincia");

      // Vaciamos todos los markers
      markerGroup.clearLayers();

      // Sumamos markers de productores
      $.each(cachedOffices[provincia], function (k, v) {
        L.marker([v.latitud, v.longitud], { icon: customMarker })
          .addTo(markerGroup)
          .bindPopup(
            "<img src='" +
              themePath +
              "assets/img/oficinas/" +
              v.imagen +
              "' alt='' width='300' height='220' /><h1>" +
              k +
              "</h1><p>" +
              v.direccion +
              "</p><p>" +
              v.telefono +
              "</p><p><a href='mailto:" +
              v.email +
              "'>" +
              v.email +
              "</a></p>"
          );
      });

      // Al abrir un modal, centrar mapa en marker y popup
      map.on("popupopen", function (e) {
        var px = map.project(e.target._popup._latlng); // find the pixel location on the map where the popup anchor is
        px.y -= e.target._popup._container.clientHeight / 2; // find the height of the popup container, divide by 2, subtract from the Y axis of marker location
        map.panTo(map.unproject(px), { animate: true }); // pan to new center
      });

      // Centrar el mapa en los markers encontrados
      map.fitBounds(markerGroup.getBounds());
    });
  }
});

