// Save step
function saveStep(id, data) {
  let parsedData = {};
  data.forEach(({ name, value }) => {
    if (value != "" && value != '0') {
      parsedData[name] = value;
    }
  });

  $.post(themePath + "inc/ajax-terceros.php", {
    consulta: 'guardar',
    paso: id,
    data: parsedData,
  }).done(function (data) {
    if (!data) {
      console.error('Error when submiting data: ', parsedData);
    }
  });
}

// Scroll hacia un elemento
function scrollToElement(element) {
  // Scrollear al prximo paso
  $("html, body").animate(
    {
      scrollTop: element.offset().top - 16,
    },
    600
  );
}

//  Prximo paso
function nextStep(el) {
  var parent = el.parents(".paso");

  if (parent.nextAll().length > 0) {
    var nextElement = parent.next(".paso");

    // Mostrar contenido del prximo paso
    nextElement.addClass("active").find(".content").show();

    // Si el paso es de documentos, ejecutar la funcin para ver qu documentos mostrar
    if (nextElement.is("#paso6")) {
      showDocuments();
    }

    // Desactivar elementos anteriores (salvo en los dos primeros pasos)
    if (nextElement.is("#paso2") || nextElement.is("#paso3")) {
      nextElement.prevAll().addClass("almostDone");
    } else {
      nextElement.prevAll().removeClass("active").addClass("done");
    }
    // Scrollear hacia el siguiente paso
    scrollToElement(nextElement);
  } else {
    // console.log("No hay prximo paso");
  }
}

// Funcin para mostrar los documentos requeridos segn las condiciones anteriores
function showDocuments() {
  var documentsFile = themePath + "data/terceros.json";
  $.getJSON(documentsFile, function (data) {
    // Agregar documentos necesarios
    $.each(data.documents, function (i, el) {
      if ($("#" + el.category).is(":checked") || el.category == "all") {
        $archivo = $([]);
        var html = $.templates.templateDocumentos.render({
          id: el.category + "-" + el.id,
          label: el.label,
        });

        $archivo.add(html).appendTo("#documentos");
      }
    });

    // Activar el botn de continuar
    $("#paso6").find(".continuar button").prop("disabled", false);
  });
}

// Validar un campo
function validateField(field) {
  var id = field.attr("id");

  // Deshabilitar campo y botn
  field.prop("readonly", true).addClass("disabled");
  field
    .next(".validar")
    .addClass("disabled")
    .append(' <i class="fas fa-circle-notch fa-spin"></i>');

  //Borrar mensajes
  field.parents("fieldset").find(".note").remove();

  // Si se validan patentes
  if (id == "patente-vehiculo-propio" || id == "patente-vehiculo-asegurado") {
    // Validar form para confirmar que tenemos fecha y hora
    $("#reclamos-de-terceros-form").validate();

    // Si el formulario es vlido...
    if ($("#reclamos-de-terceros-form").valid()) {
      /**
       * Validar patente propia Web service
       */
      if (id == "patente-vehiculo-propio") {
        $.post(themePath + "inc/ajax-terceros.php", {
          consulta: "patente",
          patente: field.val(),
          fecha: $("#fecha").val(),
          hora: $("#hora").val(),
        }).done(function (data) {
          if (data == 2) {
            // Patente ya est asegurada, debe ir a AOL
            field.prop("readonly", false).removeClass("disabled");
            field.next(".validar").removeClass("disabled").find("i").remove();
            field
              .parents("fieldset")
              .append(
                '<p class="note alert"><span>La patente corresponde a un asegurado de Cooperacin Seguros. Para un reclamo sobre tu seguro, ingres a <a href="https://asegurados.cooperacionseguros.com.ar/" target="_blank">Asegurados ONLINE</a>.</span></p>'
              );
          } else {
            // Patente no est asegurada, se puede continuar
            field
              .next(".validar")
              .text("Validada")
              .addClass("done")
              .find("i")
              .remove();

            // Botn para editar
            field
              .parent()
              .append('<span class="edit">Modificar patente</span>');

            // Autocompletar la patente en el siniestro de vehculos
            $("#dano-vehiculo-patente").val(field.val());

            // Ir al prximo elemento
            nextElement = field.parents("fieldset").next("fieldset");
            nextElement.show();
            scrollToElement(nextElement);

            // Si la patente del vehculo asegurado ya est completa y validada, se podra continuar...
            if ($("#patente-vehiculo-asegurado").hasClass("valid disabled")) {
              field
                .parents(".content")
                .find(".continuar button")
                .prop("disabled", false);
            }
          }
        });
      } else if (id == "patente-vehiculo-asegurado") {
        /**
         * Validar patente vehculo asegurado via Web service
         */
        $.post(themePath + "inc/ajax-terceros.php", {
          consulta: "patente",
          patente: field.val(),
          fecha: $("#fecha").val(),
          hora: $("#hora").val(),
        }).done(function (data) {
          if (data == 1) {
            // La patente no existe
            field.prop("readonly", false).removeClass("disabled");
            field.next(".validar").removeClass("disabled").find("i").remove();
            field
              .parents("fieldset")
              .append(
                '<p class="note alert"><span>La patente ingresada no corresponde con un asegurado de Cooperacin Seguros. Por favor, intentalo nuevamente.</span></p>'
              );
          } else if (data == 2) {
            // La patente existe y est asegurada
            field
              .next(".validar")
              .text("Validada")
              .addClass("done")
              .find("i")
              .remove();
            field
              .parents(".content")
              .find(".continuar button")
              .prop("disabled", false);

            // Botn para editar
            field
              .parent()
              .append('<span class="edit">Modificar patente</span>');
          } else if (data == 3) {
            //Patente existente con pliza NO vigente
            field.prop("readonly", false).removeClass("disabled");
            field.next(".validar").removeClass("disabled").find("i").remove();
            field
              .parents("fieldset")
              .append(
                '<p class="note alert"><span>La patente corresponde a un asegurado de Cooperacin Seguros con una pliza no vigente. Por favor, comunicate con <a href="/contacto" target="_blank">atencin al cliente</a> para recibir ayuda con tu reclamo.</span></p>'
              );
          }
        });
      }
    } else {
      // Si el form no es vlido...
      field.prop("readonly", false).removeClass("disabled");
      field.next(".validar").removeClass("disabled").find("i").remove();
    }
  }
}

// Resetear campos de un elemento
function clearForm(element) {
  element
    .find(":input")
    .not(":button, :submit, :reset, :hidden, :checkbox, :radio")
    .val("");
  element.find(":checkbox, :radio").prop("checked", false);
}

